import 'antd/dist/antd.css';
import PropTypes from 'prop-types';
// app의 부모
const App = ({Component}) => {
    return (
        <>

            <Head>
                <meta charset="utf-8"/>
                <title>Apple Farm</title>
            </Head>
            <Component/>
        </>

    );
};

App.propTypes = {
    Component: PropTypes.element.isRequired
}


export default App;
